<p>Efteråret nærmer sig med hastige skridt. Det betyder, at nattefrosten nærmer sig, og den kraftige efterårsblæst. Du kan stadig benytte dine udendørs havemøbler på dage hvor vejret er godt. Selvom du har vedligeholdelsesfrie havemøbler, er det anbefalet fra Cane-line, at du som minimum dækker dine havemøbler til, for at skærme mod regn og frost. Det får dine havemøbler til at holde længere, og du slipper for at rengøre dine havemøbler til foråret. Derudover sparer det dig også plads i garagen, carporten eller haveskuret.</p>";s:8:"metadesc";s:0:"";s:7:"metakey";s:0:"";s:11:"customtitle";s:0:"";s:4:"slug";s:7:"cover-1";s:19:"virtuemart_media_id";a:3:{i:0;s:4:"1097";i:1;s:4:"1105";i:2;s:4:"1096";}}i:9;O:8:"stdClass":8:{s:22:"virtuemart_category_id";s:2:"68";s:13:"category_name";s:6:"Indoor";s:20:"category_description";s:478:"<p><span style="color: #888888; font-family: arial,helvetica,sans-serif; font-size: small;">Cane-lines eksklusive lounge møbler er skabt af anerkendte danske designere og passer med deres klassiske udtryk ind i det moderne hjem. Lounge møblerne er blandt andet fremstillet i det bæredygtige naturprodukt rattan og er håndflettet i Indonesien, hvor der er tradition for sublimt håndværk. Kollektionen består af komfortable loungestole, loungesofa og fodskamler.</span></p>";s:8:"metadesc";s:0:"";s:7:"metakey";s:0:"";s:11:"customtitle";s:0:"";s:4:"slug";s:17:"indendørsmøbler";s:19:"virtuemart_media_id";a:4:{i:0;s:4:"1078";i:1;s:4:"1080";i:2;s:4:"1081";i:3;s:4:"1082";}}}}